import {Link, useNavigate } from 'react-router-dom';
import { handleSuccess } from '../../../utils/utils';
import { ToastContainer } from 'react-toastify';
import styles from './CompanyHome.module.css';
import { Grid, Card, CardActionArea, CardMedia, CardContent, Typography } from '@mui/material';
import Navbar from '../../../components/navbar/Navbar';
import Footer from '../../../components/footer/Footer';


function CompanyHome() {
    const navigate = useNavigate();

    const handleLogout = (e) => {
        localStorage.removeItem('token');
        localStorage.removeItem('loggedInUser');
        localStorage.removeItem('role');
        handleSuccess('User Loggedout');
        setTimeout(() => {
            navigate('/supplier-login');
        }, 1000)
    }

    return(
        <section className={styles.companyBody}>
            <Navbar 
                one="Home"
                two="nkladkj"
                three="About Us"

            />
            <button onClick={handleLogout}>Logout</button>
            
            <div className={styles.companyHomeContainerCard}>
            <Grid container spacing={2} justifyContent="center">
                {/* First Card */}
                <Grid item xs={12} sm={6} md={4} lg={3}>
                    <Card className={styles.companyHomeCard} lg={{ Width: 345 }} md={{ Width: 200 }} sm={{ Width: 150 }} xs={{ Width: 100 }}>
                        <CardActionArea>
                            <CardMedia
                                className={styles.cementCardMedia}
                                component="img"
                                height="140"
                            />
                            <CardContent className={styles.cardContent}>
                                <Typography gutterBottom variant="h5" component="div">
                                    Cement
                                </Typography>
                                <Typography variant="body2" sx={{ color: 'text.secondary' }}>
                                    Lizards are a widespread group of squamate reptiles, with over 6,000 species,
                                    ranging across all continents except Antarctica.
                                </Typography>
                            </CardContent>
                        </CardActionArea>
                    </Card>
                </Grid>

                {/* Second Card */}
                <Grid item xs={12} sm={6} md={4} lg={3}>
                    <Card sx={{ maxWidth: 345 }}>
                        <CardActionArea>
                            <CardMedia
                                className={styles.concreteCardMedia}
                                component="img"
                                height="140"
                            />
                            <CardContent className={styles.cardContent}>
                                <Typography gutterBottom variant="h5" component="div">
                                    Concrete
                                </Typography>
                                <Typography variant="body2" sx={{ color: 'text.secondary' }}>
                                    Lizards are a widespread group of squamate reptiles, with over 6,000 species,
                                    ranging across all continents except Antarctica.
                                </Typography>
                            </CardContent>
                        </CardActionArea>
                    </Card>
                </Grid>
            </Grid>
        </div>

            <Footer 
                one="Home"
                two="About Us"
                three="Contact Us"
            />
            <ToastContainer />
        </section>
    );
}
export default CompanyHome;
